svg.script:
(function () {
  "use strict";

  function init(){
    var smallProfile1 = document.getElementById('doc1');
    var smallProfile2 = document.getElementById('doc2');
    var smallProfile3 = document.getElementById('doc3');
    var smallProfile4 = document.getElementById('doc4');
    var smallProfile5 = document.getElementById('doc5');
    var smallProfile6 = document.getElementById('doc6');
    var smallProfile7 = document.getElementById('doc7');
    var smallProfile8 = document.getElementById('doc8');
    var bigProfile = document.getElementById('Group_3286');
    var check = document.getElementById('check_icon');

    var startX = 450;
    var startY = -590;
    var endX = -150;
    var endY = -245;
    var tl1 = new TimelineMax({repeat:-1});
    var tl2 = new TimelineMax({repeat:-1, delay:1.0});
    var tl3 = new TimelineMax({repeat:-1, delay:2});
    var tl4 = new TimelineMax({repeat:-1, delay:3});
    var tl5 = new TimelineMax({repeat:-1, delay:4});
    var tl6 = new TimelineMax({repeat:-1, delay:5});
    var tl7 = new TimelineMax({repeat:-1, delay:6});
    var tl8 = new TimelineMax({repeat:-1, delay:7});

    tl1.set(smallProfile1, {x:startX, y:startY, autoAlpha:0});
    tl2.set(smallProfile2, {x:startX, y:startY, autoAlpha:0});
    tl3.set(smallProfile3, {x:startX, y:startY, autoAlpha:0});
    tl4.set(smallProfile4, {x:startX, y:startY, autoAlpha:0});
    tl5.set(smallProfile5, {x:startX, y:startY, autoAlpha:0});
    tl6.set(smallProfile6, {x:startX, y:startY, autoAlpha:0});
    tl7.set(smallProfile7, {x:startX, y:startY, autoAlpha:0});
    tl8.set(smallProfile8, {x:startX, y:startY, autoAlpha:0});

    tl1.to(smallProfile1, 8, {x:endX, y:endY, ease:Power0.easeNone}, 0);
    tl2.to(smallProfile2, 8, {x:endX, y:endY, ease:Power0.easeNone}, 0);
    tl3.to(smallProfile3, 8, {x:endX, y:endY, ease:Power0.easeNone}, 0);
    tl4.to(smallProfile4, 8, {x:endX, y:endY, ease:Power0.easeNone}, 0);
    tl5.to(smallProfile5, 8, {x:endX, y:endY, ease:Power0.easeNone}, 0);
    tl6.to(smallProfile6, 8, {x:endX, y:endY, ease:Power0.easeNone}, 0);
    tl7.to(smallProfile7, 8, {x:endX, y:endY, ease:Power0.easeNone}, 0);
    tl8.to(smallProfile8, 8, {x:endX, y:endY, ease:Power0.easeNone}, 0);

    tl1.to(smallProfile1, 1, {autoAlpha:1}, 0);
    tl2.to(smallProfile2, 1, {autoAlpha:1}, 0);
    tl3.to(smallProfile3, 1, {autoAlpha:1}, 0);
    tl4.to(smallProfile4, 1, {autoAlpha:1}, 0);
    tl5.to(smallProfile5, 1, {autoAlpha:1}, 0);
    tl6.to(smallProfile6, 1, {autoAlpha:1}, 0);
    tl7.to(smallProfile7, 1, {autoAlpha:1}, 0);
    tl8.to(smallProfile8, 1, {autoAlpha:1}, 0);

    tl1.to(smallProfile1, 1, {autoAlpha:0}, 7);
    tl2.to(smallProfile2, 1, {autoAlpha:0}, 7);
    tl3.to(smallProfile3, 1, {autoAlpha:0}, 7);
    tl4.to(smallProfile4, 1, {autoAlpha:0}, 7);
    tl5.to(smallProfile5, 1, {autoAlpha:0}, 7);
    tl6.to(smallProfile6, 1, {autoAlpha:0}, 7);
    tl7.to(smallProfile7, 1, {autoAlpha:0}, 7);
    tl8.to(smallProfile8, 1, {autoAlpha:0}, 7);

    new TimelineMax().set([bigProfile,check], {autoAlpha:0}).to([bigProfile,check], .5, {autoAlpha:1, delay:1}).to([bigProfile,check], .5, {autoAlpha:0, delay:0}).repeat(-1).delay(3.7);

  }

  window.addEventListener('load', init);
}());
